package aja.config;

option optimize_for = SPEED;

message DataFile {

	required string path = 1;
	required string origin_filename = 2;

}

// error.proto
package aja.alarms;

option optimize_for = SPEED;

message Error {
	required string text = 1;
	optional string short_text = 2;
}

// alarm.proto
package aja.alarms;

option optimize_for = SPEED;

import "error.proto";

message Alarm {

	enum State {
		NORMAL = 0; // all is well, ignore the other properties
		ALARM = 1;  // alarm is raised, see severity and error for details
	}

	enum Severity {
		WARNING = 0; // general user notification/warning
		ERROR   = 1; // recoverable condition, key feature disabled (e.g. record/playback not possible)
		FATAL   = 2; // unrecoverable error, system unstable
	}

	required State state = 1; // [default = NORMAL];
	optional Severity severity = 2;
	repeated aja.alarms.Error error = 3;
}

